    SELECT "Наименование товара", SUM("Объем товара, шт.") AS total_qty
    FROM "заказы"
    GROUP BY "Наименование товара"
) t
WHERE total_qty > (
    SELECT AVG(total_qty) FROM (
        SELECT SUM("Объем товара, шт.") AS total_qty
        FROM "заказы"
        GROUP BY "Наименование товара"
    ) s
);

